import { Link , Route} from "wouter";
import App from "./App";

export default function Main() {

    return (
        <section className="main">
            <Route path="/">
                <h1>GIFWORLD</h1>
                <p>Eexplore nonasodnasdosandosndodsj</p>
                <Link to='/home'><button className="button-main">START EXPLORING</button></Link>
            </Route>
            <Route component={App} path='/home'></Route>
        </section>
    )
}
